import React,{Component} from 'react';
import {Route,Link,BrowserRouter as Router} from 'react-router-dom';
import './App.css';
import Comp from './Comp';
class App extends Component{
  constructor(){
    super();

  }
  render(){
    return(
      <Router>
         <React.Fragment>
       <Link to='user' Component={Comp}></Link>
     </React.Fragment>
      </Router>

    )
  }
}
export default App;
